// 用例测试#include <iostream>using namespace std;#include "DoMyStack.cpp"// 测试用例 g++ -std=c++11 main.cpp -o DoMyStackint main() {//    示例：////    输入：//    ["MyStack", "push", "push", "top", "pop", "empty"]//    [[], [1], [2], [], [], []]//    输出：//    [null, null, null, 2, 2, false]    // New一个Stack实例    MyStack *stack = new MyStack();    stack->push(1);    stack->push(2);    int top = stack->top(); // 2    cout << top << endl;    int pop1 = stack->pop(); // 2    cout << pop1 << endl;    bool pop2 = stack->empty(); // 0    cout << pop2 << endl;    return 0;}